                        "Name": "Surfshark Wavebreaker",
                        "Desc": "Combining her knowledge of speed control and the tides, Mualani can surf at any place, at any time.<br>After using this skill, Mualani will gain 60 Nightsoul points and enter the Nightsoul's Blessing state.<br><br><color style='color:#FFD780;'>Nightsoul's Blessing: Mualani</color><br>Continuously consume Nightsoul points. When they are depleted or when the skill is used again, Mualani's Nightsoul's Blessing will end. The state itself has the following traits:<br> · Mounts the Sharky Surfboard, increasing Mualani's Movement SPD. Mualani can move on water and in liquid Phlogiston while this state is active, and she will take no DMG from the latter.<br> · Normal Attacks will be converted to Sharky's Bites, dealing <color style='color:#80C0FF;'>Hydro DMG</color> based on Mualani's Max HP with the Nightsoul attribute. Sharky's Bites can take place in mid-air. DMG dealt this way is considered Normal Attack DMG.<br> · When she makes contact with opponents in this state, Mualani applies \"Marked as Prey\" to them and gains 1 Wave Momentum stack. Max 3 stacks. 1 stack can be gained every 0.8s per opponent.<br><br><color style='color:#FFD780;'>Wave Momentum and Marked as Prey</color><br>When Mualani uses Sharky's Bite, her DMG dealt increases based on Wave Momentum stacks. When she has 3 stacks, a Normal Attack will use Sharky's Surging Bite instead, further increasing her DMG and canceling all stacks thereafter.<br>When Shark Bite hits opponents Marked as Prey, that mark is removed, and she will fire Shark Missiles at up to 5 nearby opponents Marked as Prey, dealing DMG to them equal to this Sharky's Bite instance and clearing their Marks. If more than 1 opponent is the target of Sharky's Bite and Shark Missiles, the DMG dealt will decrease, with 28% being the maximum decrease when at least 3 opponents are targeted.<br><br><i>First off, Sharky is a freshwater shark on top of being a surfboard. Second, it doesn't truly need to eat, but it definitely will bite.</i>",
